import React from "react";
import Emoji from "./entry";
import emojipedia from "../emojipedia";

function mop(p) {
  <Emoji emoji={p.emoji} name={p.name} meaning={p.meaning} ></Emoji>
}

function App() {
  return (
    <div>
      <h1>
        <span>emojipedia</span>
      </h1>
      <dl className="dictionary">
       {emojipedia.map(mop)}
      </dl>
    </div>
  );
}

export default App;
